import React,{ Fragment } from 'react';
import Link from 'next/link';


const navigationItem = ( props ) => (
    <Fragment>
    <li>
        <Link href={props.link}>
            <a>{props.children}</a>
        </Link>
    </li>
      <style jsx>
      {`
      li{
        margin: 10px 0;
        box-sizing: border-box;
        display: block;
        width: 100%;
        
      }
      a{
        align-items: center;
      }
    `}    
      </style>
      </Fragment>
);

export default navigationItem;
